def widget_changed(self,widget:Widget):
if widget == self._widgets['listbox']:
print('list!')
self._widgets['textfield'].set_text(widget.get_selected_text())
elif widget == self._widgets['button']:
print('button!')

def handle_event(self,event):
if event==True:
self.set_active()
else:
self.set_inactive()
self.changed()
